import React from 'react';
import './hero.css';
import { Link } from 'react-router-dom';

function Hero() {
    return (
        <>
        <div className='hero-section'>
            <h1>Invest in Your Future</h1>
            <p>Titan Wealth Group is the management company for Self Storage Syndicated Equities, a Chicago, IL based investment firm that syndicates the acquisition and development of self storage facilities nationwide.</p>
            <Link to="/">
                <button className='lrn-more'>Learn More</button>
            </Link>
        </div>
        </>
        )
}

export default Hero
